-- Check if the database exists
IF NOT EXISTS (SELECT * FROM sys.databases WHERE name = 'devhive_JJuarez')
BEGIN
    CREATE DATABASE devhive_JJuarez;
END
GO

USE devhive_JJuarez;
GO

-- Verificar si existe la tabla Properties
IF NOT EXISTS (SELECT * FROM sys.tables WHERE name = 'Properties')
BEGIN
    CREATE TABLE Properties (
        Id INT IDENTITY(1,1) PRIMARY KEY, -- Identificador único
        Name NVARCHAR(100) NOT NULL, -- Nombre
        Description NVARCHAR(MAX), -- Descripción
        Tel NVARCHAR(20), -- Teléfono
        Address NVARCHAR(255), -- Dirección
        Capacity INT, -- Aforo
        Photo VARBINARY(MAX), -- Foto
        Location_Latitude FLOAT, -- Latitud
        Location_Longitude FLOAT -- Longitud
    );
END
GO

IF OBJECT_ID('dbo.DeletePropertyById', 'P') IS NOT NULL
    DROP PROCEDURE dbo.DeletePropertyById;
GO

CREATE PROCEDURE dbo.DeletePropertyById
    @Id INT
AS
BEGIN
    SET NOCOUNT ON;

    DELETE FROM Properties
    WHERE Id = @Id;
END
GO


